import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Outlet,
} from "react-router-dom";
import Header from "./components/Header";
import Footer from "./components/Footer";
import NavMenu from "./components/NavMenu";
import Home from "./pages/Home";
import AddBlog from "./pages/AddBlog";
import BlogList from "./pages/BlogList";
import Contact from "./pages/Contact";
import Grid from "@mui/material/Grid";
import Box from "@mui/material/Box";
import Paper from "@mui/material/Paper";
import { styled } from "@mui/material";
import Socials from "./components/Socials";
import BlogPageTemplate from "./pages/BlogPageTemplate";
import Subscribe from "./pages/Subscribe";
import { Toaster } from "react-hot-toast";
import { AuthContextProvider } from "./context/AuthContext";
import AdminLogin from "./pages/AdminLogin";
import {CategoriesTemplate} from "./components/CategoriesTemplate";

// Styled component for Paper element
const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === "dark" ? "#1A2027" : "#fff",
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
}));

function App() {
  return (
    // <Router>
    //   <div style={{ display: 'flex', flexDirection: 'column' }}>
    //     <Header />
    //     <div>
    //       <NavMenu />
    //     </div>

    //     <Box sx={{ flexGrow: 1 }}>
    //       <Grid container spacing={3}>
    //         <Grid item xs>
    //           <Item>Left side Bar</Item>
    //         </Grid>

    //         <Grid item xs={6}>
    //           <Item>
    //             <Routes>
    //               <Route path="/" element={<Home />} />
    //               <Route path="/BlogPage" element={<BlogPage />} />
    //               <Route path="/BlogList" element={<BlogList />} />
    //               <Route path="/AddBlog" element={<AddBlog />} />
    //               <Route path="/Contact" element={<Contact />} />
    //             </Routes>
    //           </Item>
    //         </Grid>

    //         <Grid item xs>
    //           <Item>Right side Bar</Item>
    //         </Grid>
    //       </Grid>
    //     </Box>

    //     <Footer />
    //   </div>
    // </Router>

    <AuthContextProvider>
      <Router>
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            minHeight: "100vh",
          }}
        >
          {/* Header */}
          <Header />

          {/* Cookie Trail */}
          <div
            style={{
              background: "#f5f5f5",
              textAlign: "center",
              color: "black",
            }}
          >
            Bread {">"} Crumbs {">"} to {">"} Follow
          </div>

          {/* Make a landing on contact with no nav or socials */}

          <Routes>
            <Route path="/Contact" element={<Contact />} />
          </Routes>

          <div
            style={{
              display:
                window.location.href === "http://localhost:3000/Contact"
                  ? "none"
                  : "flex",
              flex: 1,
            }}
          >
            {/* Left Sidebar */}
            {/* <div style={{padding: '20px', background: 'white' }}>
        <div style={{ background: '#white' }}> */}
            <NavMenu />
            {/* </div>
        </div> */}

            {/* Middle Content */}
            <div style={{ flex: 5, padding: "20px" }}>
              <Toaster />
              <Routes>
                <Route path="/" element={<Home />} />
                <Route
                  path="/categories/BlogPageTemplate"
                  element={<BlogPageTemplate />}
                />
                <Route path="/BlogList" element={<BlogList />} />
                <Route path="/AddBlog" element={<AddBlog />} />
                <Route path="/Subscribe" element={<Subscribe />} />
                <Route path="/admin" element={<AdminLogin />} />
                <Route path="/categories/*" element={<CategoriesTemplate />} />



                {/* <Route path="/categories/post" element={<PostTemplate />} /> */}





                {/* <Route path="/Contact" element={<Contact />} /> */}
                {/* Add more routes as needed */}
              </Routes>
            </div>

            {/* Right Sidebar */}
            <div
              id="rightBar"
              style={{ flex: "0 0 auto", padding: "20px", background: "white" }}
            >
              {/* Right sidebar content goes here */}
              <Socials />
            </div>
          </div>

          {/* Footer */}
          <Footer />
        </div>
      </Router>
    </AuthContextProvider>
  );
}

export default App;
